import React, { Component } from 'react';

import ReactImageProcess from 'react-image-process';
import swal from 'sweetalert';


import demoImg from "../../assets/ntr1.jpg";
import waterMark from "../../assets/logo1.jpg";

class Watermark extends Component {

 
  onComplete = data => {
        console.log('data:', data);
  };

    render() {
        return (
            <div>
               iMG WAATERMARK 

                <ReactImageProcess
            onComplete={this.onComplete}
            mode="waterMark"
            waterMarkType="image"
            waterMark={demoImg}
            width={100}
            height={60}
            opacity={0}
            coordinate={[430, 200]}
            >
          <img
            src={demoImg}
            alt="waterMark"
            className="example-img"
            onClick={() =>
              swal({
                text: `
                  {
                    mode:'waterMark',
                    waterMarkType:'image'
                    waterMark={waterMark}
                    width:60
                    height:60
                    opacity:0.8
                    coordinate:[330, 300]
                  }
                `
              })
            }
          />
        </ReactImageProcess>

            </div>
        );
    }
}

export default Watermark;
